$(document).on("nav-complete",()=>{Array.from($("toggle")).forEach(t=>{$(t).attr("value",null==$(t).attr("value")?"false":$(t).attr("value")),$(t).on("click",()=>{$(t).attr("value","false"==$(t).attr("value")),t.dispatchEvent(new ToggleEvent("true"==$(t).attr("value")))})})});